import React, { useEffect } from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

const loadWin95Css = () => {
  const link = document.createElement("link");
  link.rel = "stylesheet";
  link.href = process.env.PUBLIC_URL + "/assets/win95.css";
  document.head.appendChild(link);
};

function App() {
  useEffect(() => {
    loadWin95Css();
  }, []);

  return (
    <div
      className="App"
      style={{
        backgroundImage: "url('/assets/clouds2.jpg')",
        backgroundSize: "cover",
        minHeight: "100vh",
      }}
    >
      {/* Navbar */}
      <nav className="navbar navbar-expand navbar-light navbar-95">
        <ul className="navbar-nav">
          <li className="nav-item">
            <a className="nav-link" href="#about">
              <img src="/assets/icons/bookmark-3.png" alt="about" /> About Me
            </a>
          </li>

          <li className="nav-item dropdown">
            <a
              className="nav-link dropdown-toggle"
              href="#"
              role="button"
              data-toggle="dropdown"
              aria-expanded="false"
            >
              <img src="/assets/icons/cd_audio_cd_a-3.png" alt="projects" /> Projects
            </a>
            <div className="dropdown-menu">
              <a className="dropdown-item" href="#project1">Home Server GitOps</a>
              <a className="dropdown-item" href="#project2">WSS Kernel Module</a>
              <a className="dropdown-item" href="#project3">ITeamoa</a>
            </div>
          </li>

          <li className="nav-item">
            <a className="nav-link" href="#blog">
              <img src="/assets/icons/email-1.png" alt="blog" /> Blog
            </a>
          </li>

          <li className="nav-item dropdown">
            <a
              className="nav-link dropdown-toggle"
              href="#"
              role="button"
              data-toggle="dropdown"
              aria-expanded="false"
            >
              <img src="/assets/icons/directory_folder_options-5.png" alt="more" /> More
            </a>
            <div className="dropdown-menu">
              <a className="dropdown-item" href="#education">Education</a>
              <a className="dropdown-item" href="#certificates">Certificates</a>
              <a className="dropdown-item" href="#work">Work Experience</a>
              <a className="dropdown-item" href="#activities">Activities</a>
            </div>
          </li>
        </ul>
      </nav>

      {/* Sections will be defined next based on anchor links above */}
    </div>
  );
}

export default App;
